<!DOCTYPE html>
<html>
	<head>
		<title>Pantalla de pruebas</title>
		<meta http-equiv="Content-Type" content="text/html; charset=utf-8">
		<!-- Latest compiled and minified CSS -->
		<link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/3.3.4/css/bootstrap.min.css">
		<!-- Optional theme -->
		<link rel="stylesheet" href="https://maxcdn.bootstrapcdn.com/bootstrap/3.3.4/css/bootstrap-theme.min.css">
		<!-- Libreria JQUERY -->
		<script src="//code.jquery.com/jquery-1.11.2.min.js"></script>
		<!-- Latest compiled and minified JavaScript -->
		<script src="https://maxcdn.bootstrapcdn.com/bootstrap/3.3.4/js/bootstrap.min.js"></script>
		
		<script>
			$(document).ready(function(){
				
				$('#txt_url').keypress(function( e ){
					if (e.keyCode == 13 && $('#txt_url').val() != '' ) {
						$("#frscreen").attr('src',$('#txt_url').val() );
					}
				});
				
				$("#txt_ancho").keypress(function(e){
					if (e.keyCode == 13 && $('#txt_ancho').val() != '' ) {
						$("#iscreen").width($('#txt_ancho').val() );
					}
				});
				
				$("#txt_alto").keypress(function(e){
					if (e.keyCode == 13 && $('#txt_alto').val() != '' ) {
						$("#iscreen").height( $('#txt_alto').val() );
					}
				});
				
				if (localStorage.getItem('ancho') != null && localStorage.getItem('alto') != null) {
					resizeScreen(parseInt(localStorage.getItem('ancho'),10), parseInt(localStorage.getItem('alto'),10));
				}
				
			});
			
			function actualizaUrl ( newUrl ) {
				$("#txt_url").val( newUrl );
			}
			
			function resizeScreen ( ancho, alto ) {
				localStorage.setItem('ancho', ancho);
				localStorage.setItem('alto', alto);
				$("#iscreen").width(ancho);
				$("#iscreen").height(alto);
				$("#dis_dimen").html( ancho + " X " + alto );
			}
			
			
		</script>
		
		<style>
			.txt_num {
			  width : 80px;
			  margin: 0px 10px 0px 0px;
			}
			#iscreen {
			  display:block;
			  width:320px;
			  height:480px;
			  border:0px;
			  margin:0px auto;
			  background-color: #FFF;
			}
			.wrapper {
			  display:block;
			  max-width:800px;
			  margin: 10px auto 50px auto;
			}
			.panel-body{
				background-image: url('data:image/gif;base64,');
			}
		</style>
		
	</head>
	<body>
		<div class="wrapper">
		  	<h3>Pantalla Mobile</h3>
			
			<div class="row">
				<div class="col-md-10">
					<div class="input-group">
						<span class="input-group-addon" id="basic-addon1">Ancho</span>
						<input type="text" id="txt_ancho" class="form-control txt_num" placeholder="320" aria-describedby="basic-addon1">
						<span class="input-group-addon" id="basic-addon2">Alto</span>
						<input type="text" id="txt_alto" class="form-control txt_num" placeholder="480" aria-describedby="basic-addon2">
					</div>
				</div>
				<div class="col-md-2">
					<div class="btn-group">
						<button type="button" class="btn btn-info dropdown-toggle" data-toggle="dropdown" aria-expanded="false">Dispositivos <span class="caret"></span></button>
						<ul class="dropdown-menu" role="menu">
							<li role="presentation"><a role="menuitem" tabindex="-1" href="javascript:resizeScreen(320,480);">Iphone 4 / 4s 3.5"</a></li>
							<li role="presentation"><a role="menuitem" tabindex="-1" href="javascript:resizeScreen(320,568);">Iphone 5 4"</a></li>
							<li role="presentation"><a role="menuitem" tabindex="-1" href="javascript:resizeScreen(365,667);">Iphone 6 4.7"</a></li>
							<li role="presentation"><a role="menuitem" tabindex="-1" href="javascript:resizeScreen(414,736);">Iphone 6 Plus 5.5"</a></li>
						</ul>
					</div>
				</div>
			</div>
			
			<br>
			<div class="input-group">
				<span class="input-group-addon" id="basic-addon3">URL</span>
				<input type="text" id="txt_url" class="form-control" value="" placeholder="http://direccion.url" aria-describedby="basic-addon3">
			</div>
			<p>&nbsp;</p>

			<div class="panel panel-default">
				<div class="panel-heading">Visualización sitio web <strong><span id="dis_dimen">320 x 480</span></strong></div>
				<div class="panel-body">
					<div id="iscreen">
						<iframe width="100%" id="frscreen" height="100%" style="border:0px;" src=""></iframe>
					</div>
				</div>
			</div>
		</div>
	</body>
</html>
